import React from 'react'
import styled from 'styled-components'

const Navbar = styled.div`
margin-top:25px;
background-color:black;
width:100%;
height:4.5rem;
border-bottom:1px solid #03131E;

display:flex;
align-items:center;
justify-content:space-between;
flex:0;

`;
const NavBrand = styled.div`
margin-left: 10%;
`;

const NavMenu = styled.div`
background-color:#052A44;
justify-content:space-between;
position:relative;
margin-right:10rem;
text-align: center; /* Centered text/links */
ul{
    list-style:none;
    margin: 0;
    padding: 0;
    li{
        display:inline-flex; 
        padding:8px 35px;
        a{
            text-decoration: none;
            animation: before 5s ;
            @keyframes before {
                from {padding: 15px 17px;}
                to {padding: 11px 13px;}
              }

            &:hover{
                color:white;
                animation: after 2.2s ;
                @keyframes after {
                    from {padding: 11px 13px;}
                    to {padding: 15px 17px;}
                  }
            }
        }
    }
}
`;

const NavImage = styled.img`
height:2.2rem;

`;

function Header() {
  return (
    <Navbar>
        <NavBrand>
            <a href='javascript:void(0)'><NavImage src="/images/logo.png"  /></a>
        </NavBrand>

        <NavMenu>
            <ul>
                <li><a href='javascript:void(0)'>Home</a></li>
                <li><a href='javascript:void(0)'>About</a></li>
                <li><a href='javascript:void(0)'>Popular</a></li>
                <li><a href='javascript:void(0)'>Featured</a></li>
            </ul>
        </NavMenu>

    </Navbar>
  )
}

export default Header
